// src/components/Summary.js
import "./Summary.css";

const Summary = () => {
  return (
    <section className="summary" id="summary">
      <div className="container">
        <h2>Summary</h2>
        <p>
          Frontend Developer with 3.4 years of experience building scalable,
          high-performance web applications using React.js, JavaScript (ES6+),
          HTML5, CSS3, and Redux. Proven ability to develop responsive,
          accessible user interfaces, implement reusable component
          architectures, and integrate RESTful APIs. Skilled in performance
          optimization, cross-browser compatibility, and Agile development.
          Passionate about delivering seamless user experiences in fast-paced
          environments.
        </p>
      </div>
    </section>
  );
};

export default Summary;
